export default class QRPolynomial {
    num: number[];
    constructor(num: any, shift: any);
    get(index: string | number): any;
    getLength(): number;
    multiply(e: {
        getLength: () => number;
        get: (arg0: number) => any;
    }): QRPolynomial;
    mod(e: {
        getLength: () => number;
        get: (arg0: number) => any;
    }): any;
}
